    "## Question 7.1\n",
    "### Describe a situation or problem from your job, everyday life, current events, etc., for which exponential smoothing would be appropriate. What data would you need? Would you expect the value of α (the first smoothing parameter) to be closer to 0 or 1, and why?"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "dafd2261",
   "metadata": {
    "papermill": {
     "duration": 0.009362,
     "end_time": "2022-07-08T14:00:09.535850",
     "exception": false,
     "start_time": "2022-07-08T14:00:09.526488",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "I work in the grocery supply chain industry, and exponential smoothing is an appropriate modeling tool that we use in forecasting how much working capital we need for our warehouse inventory. In order to predict what we will need in the future, we observe the weighted average of what inventory we needed in the past, accounting for seasonality (holidays) and trends (think covid when everyone was buying up toilet paper and cleaning supplies or the newest health craze when kale was flying off the shelves). The challenge with forecasting inventory in an automated way is the fact that interval forecasts have changing location, variance, and shape--we're constantly purchasing new stores, rearranging which stores are serviced out of which distribution centers, and adjusting safety stock levels. The data we need are inventory dollar values and cases by category every week for the past several years as well as what holidays aligned to those weeks. Pre-pandemic I would have estimated α to be closer to 0 as we tend to roll out the same product to our stores around the same time, but the market has been volatile for the last 2 years and we're still struggling to estimate what products will be in demand or what product could go on allocation with our suppliers (formula, toiler paper, eggs, etc.) Thus, I would expect α to be closer to 1 as a result of a lot of randomness going on in the grocery business system that we could have never predicted."
   ]
  },
