    "#Turning the table of temperatures by year into a vector\n",
    "temps_vec <- as.vector(unlist(temps[,2:21]))\n",
    "\n",
    "#Creating a time series that sets the beginning unit to 1996 and updates this time every 123 observations (in order to capture to the year 2015)\n",
    "temps_ts <- ts(data = temps_vec, frequency=123, start=1996)\n",
    "\n",
    "#Quick summary of the data in the time series\n",
    "summary(temps_ts)"
   ]
