   "source": [
    "First we're going to attempt to build an exponential smoothing model using HoltWinters which is a type of triple exponential smoothing that contains the following on top of our time series data:\n",
    "\n",
    "1. alpha: the “base value”. Higher alpha puts more weight on the most recent observations.\n",
    "2. beta: the “trend value”. Higher beta means the trend slope is more dependent on recent trend slopes.\n",
    "3. gamma: the “seasonal component”. Higher gamma puts more weighting on the most recent seasonal cycles.\n",
    "\n",
    "Below we will play around with making two fits and plot them versus our raw data to see their quality. The below models are simply examples to familiarize ourselves with the influences of the alpha, beta, and gamma values (which in turn will helps us interpret our models more accurately)."
   ]
