   "source": [
    "HW1 <- HoltWinters(temps_ts)\n",
    "# Custom HoltWinters fitting\n",
    "HW2 <- HoltWinters(temps_ts, alpha=0.2, beta=0.1, gamma=0.1)\n",
    "\n",
    "#Small plot of the more recent years to see how well each of the above models fits the raw data\n",
    "ts.plot(temps_ts, xlim=c(2013,2015))\n",
    "lines(HW1$fitted[,1], lty=2, col=\"blue\")\n",
    "lines(HW2$fitted[,1], lty=2, col=\"red\")"
   ]
