   "source": [
    "The standard Holt-Winters fits uses an additive trend where it assumes that the amplitude of any seasonality components are relatively constant throughout the series  (the trend is linear). Since we're looking at temperatures in Georgia, we know there is some seasonality to the data and by using the multiplicative seasonality, we allow the seasonal variations (amplitude) to grow with the overall level of the data (changes to widths/heights of the season periods over time). Below we'll create two new models with seasonality as additive in one and multiplicative in the other with alpha, beta, and gamma set to null so function will find optimal values for these variables. Again the additive model is better if the magnitude of the variation around the trend-cycle doesn't vary with the level of the, but when the variation in teh seasonal pattern is proportionate to the level of the time series, the multiplicative model is better. In this case, we'd prefer the multiplicative model, but we'll continue testing both."
   ]
  },
