   "source": [
    "The output of HoltWinters() for both models shows beta equivalent to 0 which shows us there is no dependecy on the trend slopes, while alpha is ~0.6 in both models telling us that there is a lot more weight in our model based on recent observations and similarly gamma is ~0.5-0.6 which tells us that our model puts a little more weight on the most recent season cycles but is almost nicely in the middle of two. Now let's compare each models' SSE to see which model betters fits the raw data (remember the smaller the SSE, the better the model fits the data)."
   ]
  },
