   "source": [
    "#Plot of the raw data vs the additive and multiplicative seasonal exponential smoothing models\n",
    "ts.plot(temps_ts, xlim=c(2014.5,2015))\n",
    "lines(HW_add$fitted[,1], lty=2, col=\"blue\")\n",
    "#lines(HW_mult$fitted[,1], lty=2, col=\"red\")\n",
    "ts.plot(temps_ts, xlim=c(2014.5,2015))\n",
    "lines(HW_mult$fitted[,1], lty=2, col=\"red\")"
   ]
