   "source": [
    "Based on our plotted model, there does not seem to be a time period where summer is getting hotter or longer in Atlanta. In fact, both our models seem to closely mimic the recorded raw data. Since the final seasonal estimate (gamma) seems to be using equal weights of both early/late season cycles this leads me to believe that the data doesn't show significant increases or decreases over the 20-year period. However, to to help make a judgment of whether the unofficial end of summer has gotten later over the 20 years, we can look at the seasonal factors for every data point, and run a CUSUM analysis on them as in the previous homework (e.g., for every year, we find the day where a change is detected, and see if that date gets later over time)."
   ]
