   "source": [
    "#Creating a cumsum model in R to measure if the unofficial end of summer continues to be later\n",
    "\n",
    "cumsum = function(data, mean, T, C){\n",
    "  results = list()\n",
    "  cumsum = 0\n",
    "  rowCounter = 1\n",
    "  while (rowCounter <= nrow(data)){\n",
    "    current = data[rowCounter,]\n",
    "    cumsum = max(0, cumsum + (mean - current - C))\n",
    "    # print(cusum)\n",
    "    if (cumsum >= T) {\n",
    "      results = rowCounter\n",
    "      break}\n",
    "    rowCounter = rowCounter + 1\n",
    "    if (rowCounter >= nrow(data)){\n",
    "      results = NA\n",
    "      break}}\n",
    "  return(results)}\n",
    "\n",
    "# Setting C to be 1/2 the standard deviation of each model's data, and T to be 3 times the standard deviation of each model's data.\n",
    "add_C_var = sd(add_temps)*0.5\n",
    "add_T_var = sd(add_temps)*3\n",
    "\n",
    "multi_C_var = sd(multi_temps)*0.5\n",
    "multi_T_var = sd(multi_temps)*3\n",
    "\n",
    "#Running the cumulative sum model for each year to see on which day the average seasonality from the model is breached. \n",
    "add_vector = vector()\n",
    "multi_vector = vector()\n",
    "\n",
    "for (col in 1:ncol(add_temps)){\n",
    "  add_vector[col] = cumsum(data = as.matrix(add_temps[,col]), mean = mean(add_temps),T = add_T_var, C = add_C_var)\n",
    "}\n",
    "\n",
    "for (col in 1:ncol(add_temps)){\n",
    "  multi_vector[col] = cumsum(data = as.matrix(multi_temps[,col]), mean = mean(multi_temps),T = multi_T_var, C = multi_C_var)\n",
    "}\n",
    "\n",
    "add_result_df = data.frame(Year = colnames(add_temps),Day = temps[add_vector,1])\n",
    "multi_result_df = data.frame(Year = colnames(multi_temps),Day = temps[multi_vector,1])\n",
    "\n",
    "#print out unofficial end of summer date (where seasonality first dips below average of each model)\n",
    "add_result_df\n",
    "multi_result_df"
   ]
  },
