   "source": [
    "Based on both our additive and multiplicative models, it appears that unoffical end of summer has increased by 3-4 days over time, but this range is much tighter (and the date much later) than in the last HW when we created a cumulative sum model on the unsmoothed data. I believe this is because we have addressed the seasonality component of the data allowing us to make better predictions as to true changes of the model are occurring (where before it was chalked more up to randomness and averages than seasonality)."
   ]
