   "source": [
    "I wanted to test the HW models futher and discovered the \"decompose()\" function in R which can be used to to estimate the trend component and seasonal component of a seasonal time series of an additive model. This function estimates the trend, seasonal, and irregular components of a time series that can be described using an additive model and returns a list object with estimates of the seasonal component, trend component and irregular component stored in named elements of that list objects, called “seasonal”, “trend”, and “random.\""
   ]
