    "#Subtracting the seasonal component from the original time series we can obtain a seasonally adjusted time series as shown in this plot here vs the original time series\n",
    "add_modeladj <- temps_ts - add_model$seasonal\n",
    "plot(add_modeladj, xlim=c(2014.5,2015))\n",
    "lines(temps_ts, lty=2, col=\"blue\")"
