    "Again with being employed in the grocery supply chain industry, we are constantly forecasting sales for the business which require a large number of factors to predict. Linear regression is a great model to use in predicting sales as it allows us to understand how are warehouses are/are not succeeding as well as what teh future of our business can look like base don past sales performance and future targets. Some of the factors we use to help predict sales include months (holidays have a big influence on sales), labor hours, # of stores serviced, cases picked (what we ship to each retail store), and outbound loads (how many trucks we are shipping and how full they are when we send them out). Regression analysis in this way helps us determine if we need to increase supplies, labor, production, or even the size of our warehouses if sales are beginning to outweigh what we can service with our current distribution centers."
   ]
