   "source": [
    "uscrime <- read.table(\"../input/week-3-hw3/data 8.2/uscrime.txt\", header = TRUE, sep = \"\", check.names=FALSE)\n",
    "\n",
    "#Cheeck whether the dependent variables follows a normal distibution. The data appears to be skewed right (tail is on the right side) with more observations on the left. We would hope for our observations to be more bell-shaped to preceed with linear regression, so we might need to transform the data in order to create a better model. For now, let us proceed.\n",
    "hist(uscrime$Crime)"
   ]
  },
