   "source": [
    "#Create a regression model using all the variables in the dataset\n",
    "model1 <- lm(formula = Crime ~ ., data = uscrime)\n",
    "\n",
    "#Quick summary of our first model. We can see that R-squared is 0.8 which is great(!) but when adjusted comes down to 0.7. However, the RSE is 209.1 which tells me the model will predict crime with an average error of about 209.1. Our p-value also looks significant as it P < 0.05, but we should attempt to improve our model since there are so many coefficients. Surely some of them are not valuable to the model.\n",
    "summary(model1)"
   ]
  },
