   "source": [
    "best_model <- lm(formula = Crime ~ M + Ed + Po1 + M.F + U1 + U2 + Ineq + Prob, data = uscrime)\n",
    "\n",
    "#While our p-value has significantly improved (almost equal to 0!), R-squared has decreased from 0.8 to 0.78. However, this trade off is worth it as adjusted R-squared has increased from 0.7 to 0.74. The residuals also appear to be symmetrical around a median close to 0 which is a sign that our model is a good fit. Finally, a small p-value (Pr(>|t|) for each coefficient indicates that it is unlikely we will observe a relationship between the predictor (Crime) and response variables due to chance. Typically, a p-value of 5% or less is a good cut-off point. In our model example, the p-values are very close to zero with the exception of U1. Given that the mean crime rate is -6426.10 and that the Residual Standard Error is 195.5, we can say that the percentage error is (any prediction would still be off by) 32.8%. \n",
    "summary(best_model)"
   ]
