   "source": [
    "For a Poisson distribution, the mean and the variance should be equal. We can tell from the code above that this is not the case, the variance is much greater than the mean, which suggests that we will have over-dispersion in the model. If the residual deviance is greater than the degrees of freedom, then over-dispersion exists (whifch is the case in our model) and means that the estimates are correct but the standard errors are wrong and unaccounted for by the model.\n",
    "\n",
    "The residual deviance is a measure of the lack of fit of the model as a whole, whereas the null deviance tells us how well we can predict our output only using the intercept. The smaller the better for both of these measurements, and the bigger the difference between the null deviance and residual deviance the more helpful the input variables are in predicting the output varialbe. \n",
    "\n",
    "The AIC is another measure of goodness of fit that takes into account the ability of the model to fit the data but is not helpful in isolation. One would compare it to the AIC of some alternative model and whichever model has a lower AIC has a better fit after adjusting for the number of parameters.\n",
    "\n",
    "In this model's case, all the variables are signficant given how small their p-values are and the resulting formula would be Crime = exp(0.106169 + 0.091006 M + 0.193788 Ed + 0.094665 Po1 + 0.014778 M.F -6.908925 U1 + 0.066768 U2 + 61.33 Ineq -4.884275 Prob). Plugging in the variables from the problem earlier this equates to a crime rate of 964.1073 which is in the realms of out multiple linear regression model earlier."
   ]
